pragma solidity 0.7.5;


contract HelloWorld {

    string message;

    constructor(string memory _message){ 
        message = _message;
    }

//Control F
    function Hello(int number) public view returns(string memory){  
        if(number == 10){
            return message;
        } 
        else{
            return "Wrong number";
        }
    }
}
